\begin{cases}
\frac{a}{b}x & \text{ if }x\le-4, \\
abx^2 & \text{ if }x>-4.
\end{cases}
\]If $f(-4)=-\frac{60}{13}$ and $f(4)=3120$, what is $a+b$?,Level 4,Algebra,"Since $-4\le-4$, we know that $f(-4)=\frac{a}{b}(-4)=-\frac{60}{13}$. So, $\frac{a}{b}=\frac{15}{13}$. Next we look at $4>-4$, so $f(4)=ab\cdot4^2=3120$. That means $ab=\frac{3120}{16}=195$. Now that we have two equations and two variables, we can solve for $a$ and $b$. From $ab=195$, we get that $a=\frac{195}{b}$. We substitute this value for $a$ into the equation $\frac{a}{b}=\frac{15}{13}$ to get $\frac{195}{b^2}=\frac{15}{13}$.

